script: |
  super -f text -I q8632.spq | sort > q8632.out

inputs:
  - name: q8632.spq
    data: |
      SELECT - - 25 + + col0 * + col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( - CAST ( + - 63 AS INTEGER ) ) / + col2 * - col2 - 1 + - + 71 - 32 + - col0 > - 56;
  - name: tab1

outputs:
  - name: q8632.out
    data: |
